// src/pages/Home.js
import React from 'react';
import { Container, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <Container maxWidth="sm" style={{ marginTop: '2rem', textAlign: 'center' }}>
      <Typography variant="h3" gutterBottom>
        Welcome to Job Skill App
      </Typography>
      <Typography variant="h6" gutterBottom>
        Connect with skilled workers or offer your services today!
      </Typography>
      <Button variant="contained" color="primary" component={Link} to="/login" style={{ marginRight: '1rem' }}>
        Login
      </Button>
      <Button variant="outlined" color="primary" component={Link} to="/register-worker">
        Register as Worker
      </Button>
    </Container>
  );
};

export default Home;
